create table User (
	id INT,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	username VARCHAR(50),
	password VARCHAR(50),
	gender VARCHAR(50),
	ipaddress VARCHAR(20),
	address.street VARCHAR(50),
	address.city VARCHAR(50),
	address.state VARCHAR(50),
	address.zipcode VARCHAR(50),
	phone_number VARCHAR(50),
	job_title VARCHAR(50),
	department VARCHAR(50),
	company.name VARCHAR(50),
	company.industry VARCHAR(50),
	isActive VARCHAR(50)
);
